import './App.css';
import React from 'react';

import Primeiro from './components/Primeiro';
import ComParamentro from './components/ComParamentro';
import ComFilhos from './components/ComFilhos';
import Card from './components/layout/Card';

export default (props) => (

    <div>

        <Card titulo="Componente com parametro">
            <ComParamentro titulo="Esse é o Titulo" subtitulo="Esse é o subtitulo" />
            <ComParamentro titulo="Opsss" subtitulo="Opsss subtitulo" />
        </Card>

        <Card titulo="Componentes com filhos"> 
            <ComFilhos>
                <ul>
                    <li>Ana</li>
                    <li>Bia</li>
                    <li>Carlos</li>
                    <li>Daniel</li>
                </ul>
            </ComFilhos>
        </Card>

        <Card titulo="Primeiro Componente">
            <Primeiro />
        </Card>

        <Card titulo="Exercio X">
            Conteudo
        </Card>
    </div>

);
